import React from "react";
import mainBackground from "./mainImages/japanRoad.png";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img
          className="Background"
          src={mainBackground}
          alt="Main Background"
        />
        <div className="Intro-Writing">
          <h1>Jack Painter</h1>
          <h2>Full-Stack Developer</h2>
          <h2>(London)</h2>
        </div>
      </header>

    </div>
  );
}

export default App;
